 const external = {
     /**
      * 链接服务器地址json文件
      */
     server_json: require('../../commons/json/config.json'),
     /**
      * 跳转箭头图片
      */
     arrow_icon: require('../../commons/img/arrow.png'),
     /**
      * 天空站点标志图片
      */
     marker_helicopter_icon: require('../../commons/img/helicopter.png'),
     /**
      * 地面站点标志图片
      */
     marker_b_icon: require('../../commons/img/b.png'),
     /**
      * 视频标注图标
      */
     marker_video_icon: require('../../commons/img/icon-s.png'),
     /**
      * 单点标注默认图标
      */
     marker_default_icon: require('../../commons/img/dw.png'),
     /**
      * 单点标注默认动态图标
      */
     marker_default_anim_icon: require('../../commons/img/new_spotd07_gif.png'),

     /**
      * 探面放大图标
      */
     plusSign_icon: require('../../commons/img/fd.png'),
     /**
      * 探面缩小图标
      */
     minusSign_icon: require('../../commons/img/sx.png')
 };

 module.exports = external;
